INSERT INTO `questiondata` (`QNo`, `Statement`, `Common Info`, `Image`, `option1`, `option2`, `option3`, `option4`, `Answer`, `Difficulty`, `Topic`) VALUES
(1, 'Raju can do 25% of a piece of work in 5 days. How\r\nmany days will he take to complete the work ten\r\ntimes?', '', '', '150 days', '250 days', '200 days', '180 days', 'c', 'Level 1', 'TW'),
(2, '6 men can do a piece of work in 12 days. How many\nmen are needed to do the work in 18 days.\n', '', '', '3 men', '6 men', '4 men', '2 men', 'c', 'Level 1', 'TW'),
(3, 'A can do a piece of work in 20 days and B can do\nit in 15 days. How long will they take if both work\ntogether?\n', '', '', '8(6/7) days', '8(4/7) days', '9(3/7) days', '9(4/7) days', 'b', 'Level 1', 'TW'),
(4, 'A can do a piece of work in 20 days and B can do\nit in 15 days. IfC who canfinishsame work in \n25 days, joins them, then how long will they take\nto complete the work?', '', '', '6(18/47) days', '12 days', '2(8/11) days', '47(6/18) days', 'a', 'Level 1', 'TW'),
(5, 'Nishu and Archana can do a piece of work in 10\ndays and Nishu alone can do it in 12 days. In how\nmany days can Archana do it alone?\n', '', '', '60 days ', '30 days ', '50 days', '45 days', 'a', 'Level 1', 'TW'),
(6, 'Baba alone can do a piece of work in 10 days. Anshu\nalone can do it in 15 days. If the total wages for\nthe work is $50. How much should Baba be paid\nif they work together for the entire duration of the\nwork?\n', '', '', '$30', '$20', '$50', '$40', 'a', 'Level 1', 'TW'),
(7, '4 men and 3 women finish a job in 6 days, and 5\r\nmen and 7 women can do the same job in 4 days.\r\nHow long will 1 man and 1 woman take to do the\r\nwork?', '', '', '22(2/7) days', '25(1/2) days', '5(1/7) days', '12(7/22) days', 'a', 'Level 1', 'TW'),
(8, 'If 8 boys and 12 women can do a piece of work in\n25 days, in how many days can the work be done\nby 6 boys and 11 women working together?\n', '', '', '15 days', '10 days', '12 days', 'Cannot be determined', 'd', 'Level 1', 'TW'),
(9, 'A can do a piece of work in 10 days and B can do\nthe same work in 20 days. With the help of C, they\nfinish the work in 5 days. How long will it take for\nC alone to finish the work?\n', '', '', '20 days', '10 days', '35 days', '15 days', 'a', 'Level 1', 'TW'),
(10, 'A can do a piece of work in 20 days. He works at\nit for 5 days and then B finishes it in 10 more days.\nIn how many days will A and B together finish the\nwork?\n', '', '', '8 days', '10 days', '12 days', '6 days', 'a', 'Level 1', 'TW'),
(11, 'A and B undertake to do a piece of work for $100.\r\nA can do it in 5 days and B can do it in 10 days.\r\nWith the help of C, they finish it in 2 days. How\r\nmuch should C be paid for his contribution?', '', '', '$40', '$20', '$60', '$30', 'a', 'Level 1', 'TW'),
(12, 'Twenty workers can finish a piece of work in 30\ndays. After how many days should 5 workers leave\nthe job so that the work is completed in 35 days?\n', '', '', '5 days', '10 days', '15 days', '20 days', 'c', 'Level 1', 'TW'),
(13, 'Arun and Vinay together can do a piece of work in\n7 days. If Arun does twice as much work as Vinay\nin a given time, how long will Arun alone take to\ndo the work.', '', '', '6.33 days', '10.5 days', '11 days', '72 days', 'b', 'Level 1', 'TW'),
(14, 'Subhash can copy 50 pages in 10 hours; Subhash and\nPrakash together can copy 300 pages in 40 hours. In\nhow much time can Prakash copy 30 pages?\n', '', '', '13 h', '12 h', '11 h', '9 h', 'b', 'Level 1', 'TW'),
(15, 'X number of men can finish a piece of work in 30 days. If there were 6 men more, the work could be finished in 10 days less. What is the original number\nof men?\n', '', '', '10', '11', '12', '15', 'c', 'Level 1', 'TW'),
(16, 'Sashi can do a piece of work in 25 days and Rishi\ncan do it in 20 days. They work for 5 days and then\nSashi goes away. In how many more days will Rishi\nfinish the work?\n', '', '', '10 days', '12 days', '14 days', 'None of These', 'd', 'Level 1', 'TW'),
(17, 'Raju can do a piece of work in 10 days, Vicky in 12\ndays and Tinku in 15 days. They all start the work\ntogether, but Raju leaves after 2 days and Vicky\nleaves 3 days before the work is completed. In how\nmany days is the work completed?\n', '', '', '5 days', '6 days', '7 days ', '8 days', 'c', 'Level 1', 'TW'),
(18, 'Sambhu can do 1/2 of the work in 8 days while Kalu\r\ncan do 1/3 of the work in 6 days. How long will it\r\ntake for both of them to finish the work?\r\n', '', '', '88/17 days', '144/17 days', '72/17 days', '8 days', 'b', 'Level 1', 'TW'),
(19, 'Manoj takes twice as much time as Anjay and thrice\nas much as Vijay to finish a piece of work. Together\nthey finish the work in 1 day. What is the time taken\nby Manoj to finish the work?\n', '', '', '6 days ', '3 days', '2 days', '4 days', 'a', 'Level 1', 'TW'),
(20, 'An engineer undertakes a project to build a road 15\nkm long in 300 days and employs 45 men for the\npurpose. After 100 days, he finds only 2.5 km of the\nroad has been completed. Find the (approx.) number\nof extra men he must employ to finish the work in time.\n', '', '', '43', '45', '55', '68', 'd', 'Level 1', 'TW'),
(21, 'Apurva can do a piece of work in 12 days. Apurva\nand Amit complete the work together and were paid\n$54 and $81 respectively. How many days must\nthey have taken to complete the work together?\n', '', '', '4 days', '4.5 days', '4.8 days', '5 days', 'c', 'Level 1', 'TW'),
(22, 'Raju is twice as good as Vijay. Together, they finish\nthe work in 14 days. In how many days can Vijay\nalone do the same work?\n', '', '', '16 days', '21 days', '32 days', '42 days', 'd', 'Level 1', 'TW'),
(23, 'In a company XYZ Ltd. a certain number of engi-\nneers can develop a design in 40 days. If there were\n5 more engineers, it could be finished in 10 days less.\nHow many engineers were there in the beginning?\n', '', '', '18', '20', '25', '15', 'd', 'Level 1', 'TW'),
(24, 'If 12 men and 16 boys can do a piece of work in 5\ndays and 13 men and 24 boys can do it in 4 days,compare the daily work done by a man with that\ndone by a boy?\n', '', '', '1:2', '1:3', '2:1', '3:1', 'c', 'Level 1', 'TW'),
(25, 'A can do a work in 10 days and B can do the same\nwork in 20 days. They work together for 5 days and\nthen A goes away. In how many more days will B\nfinish the work?\n', '', '', '5 days', '6.5 days', '10 days', '8.33 days', 'a', 'Level 1', 'TW'),
(26, '30 men working 5 h a day can do a work in 16 days.\nIn how many days will 20 men working 6 h a day\ndo the same work?\n', '', '', '22.5 days', '20 days', '21 days', 'none of these', 'b', 'Level 1', 'TW'),
(27, 'Ajay and Vijay undertake to do a piece of work for\n$200. Ajay alone can do it in 24 days while Vijay\nalone can do it in 30 days. With the help of Pradeep,\nthey finish the work in 12 days. How much should\nPradeep get for his work?\n', '', '', '$20', '$100', '$180', '$50', 'a', 'Level 1', 'TW'),
(28, '15 men could finish a piece of work in 210 days. But\nat the end of 100 days, 15 additional men are employed.\nIn how many more days will the work be complete?\n', '', '', '80 days', '60 days', '55 days', '50 days', 'c', 'Level 1', 'TW'),
(29, 'Ajay, Vijay and Sanjay are employed to do a piece\nof work for $529. Ajay and Vijay together are\nsupposed to do 19/23 of the work and Vijay and\nSanjay together 8/23 of the work. How much should\nAjay be paid?\n', '', '', '$245', '$295', '$300', '$345', 'd', 'Level 1', 'TW'),
(30, 'Anmol is thrice as good a workman as Vinay and\r\ntherefore is able to finish the job in 60 days less\r\nthan Vinay. In how many days will they finish the\r\njob working together?\r', '', '', '22(1/2) days', '11(3/2) days', '15 days', '20 days', 'a', 'Level 1', 'TW'),
(31, 'In a fort there was sufficient food for 200 soldiers\nfor 31 days. After 27 days 120 soldiers left the fort.\nFor how many extra days will the rest of the food\nlast for the remaining soldiers?', '', '', '12 days ', '10 days', '8 days', '6 days', 'd', 'Level 1', 'TW'),
(32, 'Anju, Manju and Sanju together can reap a field in 6\ndays. If Anju can do it alone in 10 days and Manju\nin 24 days. In how many days will Sanju alone be\nable to reap the field?\n', '', '', '40 days', '36 days', '35 days', '32 days', 'a', 'Level 1', 'TW'),
(33, 'Ajay and Vijay can do a piece of work in 28 days.\nWith the help of Manoj, they can finish it in 21\ndays. How long will Manoj take to finish the work\nall alone?\n', '', '', '84 days ', '80 days', '75 days', '70 days', 'a', 'Level 1', 'TW'),
(34, 'Ashok and Mohan can do a piece of work in 12\ndays. Mohan and Binod together do it in 15 days.\nIf Ashok is twice as good a workman as Binod. In\nhow much time will Mohan alone can do the work?\n', '', '', '15 days', '20 days', '25 days', '35 days', 'b', 'Level 1', 'TW'),
(35, 'Ajay and Vijay together can do a piece of work in 6\ndays. Ajay alone does it in 10 days. What time does\nVijay require to do it alone?\n', '', '', '20 days', '15 days', '25 days', '30 days', 'b', 'Level 1', 'TW'),
(36, 'A cistern is normally filled in 5 hours. However, it\ntakes 6 hours when there is leak in its bottom. If the\ncistern is full, in what time shall the leak empty it?\n', '', '', '6 h', '5 h', '30 h', '15 h', 'c', 'Level 1', 'TW'),
(37, 'Pipe A and B running together can fill a cistern in 6\nminutes. If B takes 5 minutes more than A to fill the\ncistern, then the time in A and B will fill the cistern\nseparately what time?', '', '', '15 min, 20 min', '15 min, 10 min', '10 min, 15 min', '25 min, 20 min', 'c', 'Level 1', 'TW'),
(38, 'A can do a work in 18 days, B in 9 days and C in\n6 days. A and B start working together and after 2\ndays C joins them. In how many days will the job\nbe completed?\n', '', '', '4.33 days', '4 days', '4.66 days', '5 days', 'b', 'Level 1', 'TW'),
(39, '24 men working 8 h a day can finish a work in 10\ndays. Working at a rate of 10 h a day, the number\nof men required to finish the work in 6 days is\n', '', '', '30', '32', '34', '36', 'b', 'Level 1', 'TW'),
(40, 'A certain job was assigned to a group of men to do\nit in 20 days. But 12 men did not turn up for the\njob and the remaining men did the job in 32 days.\nThe original number of men in group was\n', '', '', '32', '34', '36', '40', 'a', 'Level 1', 'TW'),
(41, '12 men complete a work in 18 days. 6 days after\r\nthey had started working, 4 men join them. How many more days will all of them take to complete\r\nthe remaining work?', '', '', '10 days', '12 days', '15 days', '9 days', 'd', 'Level 1', 'TW'),
(42, 'A takes 5 days more than B to do a certain job and\r\n9 days more than C; A and B together can do the\r\njob in the same time as C. How many days A would\r\ntake to do it?', '', '', '16 days', '10 days', '15 days', '20 days', 'c', 'Level 1', 'TW'),
(43, 'A cistern is normally filled in 6 h but takes 4 h longer\nto fill because of a leak in its bottom. If the cistern\nis full, the leak will empty it in how much time?\n', '', '', '15 h', '16 h', '20 h', 'None of These', 'a', 'Level 1', 'TW'),
(44, 'If three taps are open together, a tank is filled in 10\nh. One of the taps can fill in 5 h and another in 10\nh. At what rate does the 3rd pipe work?\n', '', '', 'waste pipe emptying the tank is 10 h', 'Waste pipe emptying the tank is 20 h\r\n', 'Waste pipe emptying the tank is 5 h', 'Fills the tank in 10 h', 'c', 'Level 1', 'TW'),
(45, 'There are two pipes in a tank. Pipe A is for filling\nthe tank and Pipe B is for emptying the tank. If A\ncan fill the tank in 10 hours and B can empty the\ntank in 15 hours then find how many hours will it\ntake to completely fill a half empty tank?\n', '', '', '30 hours ', '15 hours', '20 hours', '33.33 hours', 'b', 'Level 1', 'TW'),
(46, 'Abbot can do some work in 10 days, Bill can do\nit in 20 days and Clinton can do it in 40 days.\nThey start working in turns with Abbot starting\nto work on the first day followed by Bill on the\nsecond day and by Clinton on the third day and\nagain by Abbot on the fourth day and so on till\nthe work is completed fully. Find the time taken\nto complete the work fully?\n', '', '', '16 days', '15 days', '17 days', '16.5 days', 'd', 'Level 1', 'TW'),
(47, 'A, B and C can do some work in 36 days. A and B\ntogether do twice as much work as C alone and A and\nC together can do thrice as much work as B alone.\nFind the time taken by C to do the whole work.\n', '', '', '72 days', '96 days', '108 days', '120 days', 'c', 'Level 1', 'TW'),
(48, 'There are three Taps A, B and C in a tank. They can\r\nfill the tank in 10 hrs, 20 hrs and 25 hrs, respectively.\r\nAt first, all of them are opened simultaneously. Then\r\nafter 2 hours, tap C is closed and A and B are kept\r\nrunning. After the 4th hour, tap B is also closed.\r\nThe remaining work is done by Tap A alone. Find\r\nthe percentage of the work done by Tap A by itself.', '', '', '32%', '52%', '75%', 'None of These', 'd', 'Level 1', 'TW'),
(49, 'Two taps are running continuously to fill a tank. The\r\n1st tap could have filled it in 5 hours by itself and\r\nthe second one by itself could have filled it in 20\r\nhours. But the operator failed to realise that there was\r\na leak in the tank from the beginning which caused a\r\ndelay of one hour in the filling of the tank. Find the\r\ntime in which the leak would empty a filled tank.', '', '', '15 hours', '20 hours', '25 hours', '40 hours', 'b', 'Level 1', 'TW'),
(50, 'A can do some work in 24 days, B can do it in 32\ndays and C can do it in 60 days. They start working\ntogether. A left after 6 days and B left after working\nfor 8 days. How many more days are required to\ncomplete the whole work?\n', '', '', '30', '25', '22', '20', 'c', 'Level 1', 'TW'),
(51, 'Two forest officials in their respective divisions were\ninvolved in the harvesting of tendu leaves. One divi-\nsion had an average output of 21 tons from a hectare\nand the other division, which had 12 hectares of land\nless, dedicated to tendu leaves, got 25 tons of tendu\nfrom a hectare. As a result, the second division har-\nvested 300 tons of tendu leaves more than the first.\nHow many tons of tendu leaves did the first division\nharvest?\n', '', '', '3150', '3450', '3500', '3600', 'a', 'Level 2', 'TW'),
(52, 'According to a plan, a drilling team had to drill to\na depth of 270 metres below the ground level. For\nthe first three days the team drilled as per the plan.\nHowever, subsequently finding that their resources\nwere getting underutilised according to the plan, it\nstarted to drill 8 metres more than the plan every day.\nTherefore, a day before the planned date they had\ndrilled to a depth of 280 metres. How many metres\nof drilling was the plan for each day.', '', '', '38 meters', '30 meters', '27 meters', '28 meters', 'b', 'Level 2', 'TW'),
(53, 'A pipe can fill a tank in x hours and another can\r\nempty it in y hours. If the tank is 1/3rd full then the\r\nnumber of hours in which they will together fill it\r\nin is', '', '', '(3xy)/2(y-x)', '(3xy)/(y-x)', '(xy)/3(y-x)', '(2xy)/3(y-x)', 'd', 'Level 2', 'TW'),
(54, 'Dev and Tukku can do a piece of work in 45 and 40\r\ndays respectively. They began the work together, but\r\nDev leaves after some days and Tukku finished the\r\nremaining work in 23 days. After how many days\r\ndid Dev leave', '', '', '7 days', '8 days', '9 days', '11 days', 'c', 'Level 2', 'TW'),
(55, 'A finishes 6/7th of the work in 2z hours, B works\r\ntwice as fast and finishes the remaining work. For\r\nhow long did B work?', '', '', '(2/3)z', '(6/7)z', '(6/49)z', '(3/18)z', 'd', 'Level 2', 'TW'),
(56, 'Ajit can do as much work in 2 days as Baljit can do\r\nin 3 days and Baljit can do as much in 4 days as\r\nDiljit in 5 days. A piece of work takes 20 days if all\r\nwork together. How long would Baljit take to do all\r\nthe work by himself?', '', '', '82 days', '44 days', '66 days', '50 days', 'c', 'Level 2', 'TW'),
(57, 'Two pipes can fill a cistern in 14 and 16 hours respec-\ntively. The pipes are opened simultaneously and it is\nfound that due to leakage in the bottom of the cistern,\nit takes 32 minutes extra for the cistern to be filled up. When the cistern is full, in what time will the\r\nleak empty it?', '', '', '114 h', '112 h', '100 h', '80 h', 'b', 'Level 2', 'TW'),
(58, 'A tank holds 100 gallons of water. Its inlet is 7 inches\r\nin diametre and fills the tank at 5 gallons/min. The\r\noutlet of the tank is twice the diametre of the inlet.\r\nHow many minutes will it take to empty the tank\r\nif the inlet is shut off, when the tank is full and the\r\noutlet is opened? (Hint: Rate of filling or emptying\r\nis directly proportional to the diametre)', '', '', '7.14 min', '10 min', '0.7 min', '0.5 min', 'b', 'Level 2', 'TW'),
(59, 'A tank of capacity 25 litres has an inlet and an out-\r\nlet tap. If both are opened simultaneously, the tank\r\nis filled in 5 minutes. But if the outlet flow rate is\r\ndoubled and taps opened the tank never gets filled\r\nup. Which of the following can be outlet flow rate\r\nin litres/min?', '', '', '2', '6', '4', '3', 'b', 'Level 2', 'TW'),
(60, 'X takes 4 days to complete one-third of a job, Y\r\ntakes 3 days to complete one-sixth of the same work\r\nand Z takes 5 days to complete half the job. If all\r\nof them work together for 3 days and X and Z quit,\r\nhow long will it take for Y to complete the remaining\r\nwork done.', '', '', '6 days', '8.1 days', '5.1 days', '7 days', 'c', 'Level 2', 'TW'),
