(135, 'A boat rows 16 km up the stream and 30 km down-\nstream taking 5 h each time. The velocity of the\ncurrent\n', '', '', '1.1 km/h', '1.2 km/h', '1.4 km/h', '1.5 km/h', 'c', 'Level 2', 'TSD'),
(136, 'Vijay can row a certain distance downstream in 6 h\nand return the same distance in 9 h. If the stream\nflows at the rate of 3 km/h, find the speed of Vijay\nin still water.\n', '', '', '12 km/h', '13 km/h', '14 km/h', '15 km/h', 'd', 'Level 2', 'TSD'),
(137, 'Subbu can row 6 km/h in still water. When the river\nis running at 1.2 km/h, it takes him 1 hour to row\nto a place and back. How far in the place?\n', '', '', '2.88 km', '2 km', '3.12 km', '2.76 km', 'a', 'Level 2', 'TSD'),
(138, 'A dog is passed by a train in 8 seconds. Find the\nlength of the train if its speed is 36 kmph.\n', '', '', '70 m', '80 m', '85 m', '90 m', 'b', 'Level 2', 'TSD'),
(139, 'A lazy man can row upstream at 16 km/h and down-\r\nstream at 22 km/h. Find the mans rate in still water\r\n(in kmph).', '', '', '19', '14', '17', '18', 'a', 'Level 2', 'TSD'),
(140, 'A man can row 30 km upstream and 44 km down-\nstream in 10 hours. It is also known that he can row\n40 km upstream and 55 km downstream in 13 hours.\nFind the speed of the man in still water.\n', '', '', '4 km/h', '6 km/h', '8 km/h', '12 km/h', 'c', 'Level 2', 'TSD'),
(141, 'In a stream that is running at 2 km/h, a man goes 10\nkm upstream and comes back to the starting point in\n55 minutes. Find the speed of the man in still water.\n', '', '', '20 km/h', '22 km/h', '24 km/h', '28 km/h', 'b', 'Level 2', 'TSD'),
(142, 'A man goes down stream at x km/h and upstream at\ny km/h. The speed of the boat in still water is\n', '', '', '0.5(x+y)', '0.5(x-y)', 'x+y', 'x-y', 'a', 'Level 2', 'TSD'),
(143, 'The length of the minutes hand of a clock is 8\ncm. Find the distance travelled by its outer end in\n15 minutes.\n', '', '', '4 pi cm', '8 pi cm', '12 pi cm', '16 pi cm', 'a', 'Level 2', 'TSD'),
(144, 'Between 5 a.m. and 5 p.m. of a particular day for\nhow many times are the minute and the hour hands\ntogether?\n', '', '', '11', '22', '33', '44', 'a', 'Level 2', 'TSD'),
(145, 'At what time are the hands of clock together between\n2 and 3 p.m.?\n', '', '', '2/11 hours past 2 pm', '2/9 hours past 2 pm', '2:10 p.m', 'none of these', 'a', 'Level 2', 'TSD'),
(146, 'A motorboat went down the river for 14 km and then\nup the river for 9 km. It took a total of 5 hours for\nthe entire journey. Find the speed of the river flow\nif the speed of the boat in still water is 5 km/h.\n', '', '', '1 kmph', '1.5 kmph', '2 kmph', '3 kmph', 'c', 'Level 2', 'TSD'),
(147, 'A motorboat whose speed in still water is 10 km/h\nwent 91 km downstream and then returned to its\nstarting point. Calculate the speed of the river flow\nif the round trip took a total of 20 hours.\n', '', '', '3 km/h', '4 km/h', '6 km/h', '8 km/h', 'a', 'Level 2', 'TSD'),
(148, 'In a race of 600 meters, Ajay beats Vijay by 60 me-\ntres and in a race of 500 meters Vijay beats Anjay\nby 25 meters. By how many meters will Ajay beat\nAnjay in a 400 meter race?\n', '', '', '48 m', '52 m', '56 m', '58 m', 'd', 'Level 2', 'TSD'),
(149, 'A motorboat whose speed in still water is 15 kmph\ngoes 30 km downstream and comes back in a total\n4 hours 30 min. Determine the speed of the stream.\n', '', '', '2 kmph', '3 kmph', '4 kmph', '5 kmph', 'd', 'Level 2', 'TSD'),
(150, 'If we express 12(4/15)% as a fraction, then it is equal to', '', '', '46/375', '46/125', '23/250', 'None of these.', 'a', 'Level 1', 'PPL'),
(151, 'What is 10% of 20% of 25% of 100?', '', '', '0.5', '0.75', '0.25', '1', 'a', 'Level 1', 'PPL'),
(152, 'Which of the following is the largest number?', '', '', '40% of 400', '5% of 800', '1000% of 4 ', ' 200% of 9', 'a', 'Level 1', 'PPL'),
(153, 'If 30% of a number is 300, then 50% of that number is', '', '', '400', '125', '150', '500', 'd', 'Level 1', 'PPL'),
(154, 'If 25% of x = 30% of y, then find the value of x if y = 5000.', '', '', '2000', '3000', '4000', '6000', 'd', 'Level 1', 'PPL'),
(155, '30% of a% of b is 25% of b% of c. Which of the following is c?', '', '', '1.5a   ', '0.667a', '0.5a', '1.20a', 'd', 'Level 1', 'PPL'),
(156, '20% of a number when subtracted from 108, gives the number itself. Find the number.', '', '', '50', '80', '70', '90', 'd', 'Level 1', 'PPL'),
(157, 'When 40% of a number A is added to another number B, B becomes 125% of its previous value. Then which of the following is true regarding the values of A and B?', '', '', 'A>B', 'B>A', 'B=A', 'Either (a) or (b) can be true depending upon the values of A and B', 'd', 'Level 1', 'PPL'),
(160, 'Mr. Ram is worried about the balance of his monthly budget. The price of petrol has increased by 50%. By what percent should he reduce the consumption of petrol so that he is able to balance his budget?', '', '', '33.33', '28.56', '25', '14.28', 'a', 'Level 1', 'PPL'),
(161, 'Mr. Ram is worried about the balance of his monthly budget. The price of petrol has increased by 50%. By what percent should he reduce the consumption of petrol so that he is able to balance his budget. if Mr. Ram wanted to limit the increase in his expenditure to 20% on his basic expenditure on petrol then what should be the corresponding decrease in consumption?', '', '', '33.33', '12.5', '25', '20', 'd', 'Level 1', 'PPL'),
(162, 'Ashok sells his goods 50% dearer than Shankar and 20% dearer than Bishnu. How much percentage is Bishnus goods dearer than Shankars?', '', '', '33.33%', '25%', '66.66%', '40%', 'b', 'Level 1', 'PPL'),
(163, 'In an election between 2 candidates, Chaman gets 80% of the total valid votes. If the total votes were 12000, what is the number of valid votes that the other candidate Dhande gets if 15% of the total votes were declared invalid?', '', '', '1645', '1545', '1675', '2040', 'd', 'Level 1', 'PPL'),
(164, 'In a physical measurement, by mistake Shyam gave his height as 25% more than normal. In the interview panel, he clarified that his height was 5 feet 5 inches. Find the percentage correction made by the candidate from his stated height to his actual height.', '', '', '20', '28.56', '25', '16.66', 'a', 'Level 1', 'PPL'),
(165, 'Raunak generally wears his fathers coat. Unfortunately, his cousin Vikas told him one day that he was wearing a coat of length more than his height by 15%. If the length of Raunaks fathers coat is 345 cm then find the actual length (in cm) of his coat.', '', '', '110', '345', '300', '105', 'c', 'Level 1', 'PPL'),
(166, 'A number is mistakenly divided by 2 instead of being multiplied by 2. Find the percentage change in the result due to this mistake.', '', '', '100%', '125%', '200%', '75%', 'd', 'Level 1', 'PPL'),
(167, 'Sachin wanted to subtract 10 from a number. Unfortunately, he added 10 instead of subtracting. Find the percentage change in the result', '', '', '300%', '66.66%', '50%', 'Cannot be determined', 'd', 'Level 1', 'PPL'),
(168, 'In a mixture of 100 litres of milk and water, 25% of the mixture is milk. How much water should be added to the mixture so that milk becomes 20% of the mixture?', '', '', '25 litres ', '15 litres', '20 litres', '24 litres', 'a', 'Level 1', 'PPL'),
(169, 'A landowner increased the length and the breadth of a rectangular plot by 20% and 30% respectively. Find the percentage change in the cost of the plot assuming land prices are uniform throughout his plot.', '', '', '23%', '52%', '56%', 'None of these', 'c', 'Level 1', 'PPL'),
(170, 'The height of a triangle is increased by 30%. What can be the maximum percentage increase in length of the base so that the increase in area is restricted to a maximum of 90%?', '', '', '33.33%', '20.67%', '46.15%', '25.34%', 'c', 'Level 1', 'PPL'),
(171, 'Due to a 25% hike in the price of rice per kilogram,\na person is able to purchase 5 kg less for `200. Find\nthe increased price of rice per kilogram.', '', '', '$5', '$6', '$10', '$4', 'c', 'Level 2', 'PPL'),
(172, 'A fraction is such that if the double of the numera-\r\ntor and the triple of the denominator is changed by\r\n+10% and 30% respectively then we get 33% of\r\n16/21. Find the fraction.', '', '', '4/25', '8/11', '3/25', 'None Of These', 'b', 'Level 2', 'PPL'),
(173, 'After receiving two successive hikes, Karuns salary\nbecame equal to 15/8 times of his initial salary. By\nhow much percent was the salary raised the first time\nif the second raise was twice as high (in percent) as\nthe first?', '', '', '15%', '20%', '25%', '30%', 'c', 'Level 2', 'PPL'),
(174, 'After three successive equal percentage rise in the\nsalary the sum of 1000 rupees turned into 1331 ru-\npees. Find the percentage rise in the salary.\n', '', '', '10%', '22%', '66%', '82%', 'a', 'Level 2', 'PPL'),
(175, 'Sudhir, a very clever businessman, started off a\nbusiness with very little capital. In the first year,\nhe earned a profit of 50% and donated 50% of the\ntotal capital (initial capital + profit) to a charitable\norganisation. The same course was followed in the\n2nd and 3rd years also. If at the end of three years,\nhe is left with $33,750, then find the amount donated\nby him at the end of the 2nd year.\n', '', '', '$90,000', '$25,000', '$45,000', '$40,000', 'c', 'Level 2', 'PPL');
INSERT INTO `questiondata` (`QNo`, `Statement`, `Common Info`, `Image`, `option1`, `option2`, `option3`, `option4`, `Answer`, `Difficulty`, `Topic`) VALUES
(176, 'In an examination, 48% students failed in Physics\nand 32% students in Chemistry, 20% students failed\nin both the subjects. If the number of students who\npassed the examination was 880 (by passing both\nthe subjects), how many students appeared in the\nexamination if the examination consisted only of\nthese two subjects?\n', '', '', '2000', '2200', '2500', '1800', 'b', 'Level 2', 'PPL'),
(177, 'A machine depreciates in value each year at the\nrate of 10% of its previous value. However, every\nsecond year there is some maintenance work so that\nin that particular year, depreciation is only 5% of its\nprevious value. If at the end of the fourth year, the\nvalue of the machine stands at $1,46,205, then find\nthe value of machine at the start of the first year.\n', '', '', '$190,000', '$200,000', '$195,000', '$210,000', 'b', 'Level 2', 'PPL'),
(178, 'Kakus project report consists of 25 pages each of\n60 lines with 75 characters on each line. In case the\nnumber of lines is reduced to 55 but the number of\ncharacters is increased to 90 per lines, what is the\npercentage change in the number of pages. (Assume\nthe number of pages to be a whole number.)\n', '', '', '10%', '5%', '-8%', '-10%', 'c', 'Level 2', 'PPL'),
(179, 'The price of soap is collectively decided by five\nfactors: raw materials, research, labour, advertise-\nments and transportation. Assume that the functional\nrelationship is\nPrice of soap = (k * Raw material costs * Research\ncosts *Labour costs  Advertising cost *Transporta-\ntion cost).\nIf there are respective changes of 20%, 20%, 20%,\n25% and 10% in the five factors, then find the per-\ncentage change in the price of soap.\n', '', '', '58.40%', '54.40%', '48.50%', '56%', 'a', 'Level 2', 'PPL'),
(180, 'Praveen goes to a shop to buy a sofa set costing\n$13,080. The rate of sales tax is 10%. She tells the\nshopkeeper to reduce the price of the sofa set to such\nan extent that she has to pay `13080 inclusive of\nsales tax. Find the percentage reduction needed in the\nprice of the sofa set to just satisfy her requirement.\n', '', '', '8.33%', '9.09%', '9%', '8.50%', 'b', 'Level 2', 'PPL'),
(181, 'The price of a certain product was raised by 20%\nin India. The consumption of the same article was\nincreased from 400 tons to 440 tons. By how much\npercent will the expenditure on the article rise in the\nIndian economy?\n', '', '', '32%', '25%', '27%', '26%', 'a', 'Level 2', 'PPL'),
(182, 'In the university examination last year, Samanyu\nscored 65% in English and 82% in History. What is\nthe minimum percent he should score in Sociology,\nwhich is out of 50 marks (if English and History\nwere for 100 marks each), if he aims at getting 78%\noverall?\n', '', '', '94%', '92%', '98%', '96%', 'd', 'Level 2', 'PPL'),
(183, 'King Dashratha, at his eleventh hour, called his three\nqueens and distributed his gold in the following way:\nHe gave 50% of his wealth to his first wife, 50% of\nthe rest to his second wife and again 50% of the rest\nto his third wife. If their combined share is worth\n1,30,900 kilograms of gold, find the quantity of gold\nKing Dashratha was having initially?\n', '', '', '150000 kg', '149600 kg', '151600 kg', '152600 kg', 'b', 'Level 2', 'PPL'),
(184, 'The population of Swansea increases with a uniform\nrate of 8% per annum, but due to immigration, there\nis a further increase of population by 1% (however,\nthis 1% increase in population is to be calculated on\nthe population after the 8% increase and not on the\nprevious years population). Find what will be the\npercentage increase in population after 2 years.\n', '', '', '18.984', '18.081', '18.24', '17.91', 'a', 'Level 2', 'PPL'),
(185, '10% of Mexicos population migrated to South Asia,\n10% of the remaining migrated to America and 10%\nof the rest migrated to Australia. If the female popu-\nlation, which was left in Mexico, remained only\n3,64,500, find the population of Mexico City before\nthe migration and its effects if it is given that before\nthe migration the female population was half the\nmale population and this ratio did not change after\nthe migration?\n\n', '', '', '1000000', '1200000', '1500000', '1600000', 'c', 'Level 2', 'PPL'),
(186, 'Malti has `M with her and her friend Chinki has\n`C with her. Malti spends 12% of her money and\nChinki also spends the same amount as Malti did.\nWhat percentage of her money did Chinki spend?\n', '', '', '18M/C', '18C/M', '12M/C', '12C', 'c', 'Level 2', 'PPL'),
(187, 'According to a recent survey report issued by the\nCommerce Ministry, Government of India, 30% of\nthe total FDI goes to Gujarat and 20% of this goes\nto rural areas. If the FDI in Gujarat, which goes to\nurban areas, is $72 m, then find the size of FDI in\nrural Andhra Pradesh, which attracts 50% of the FDI\nthat comes to Andhra Pradesh, which accounts for\n20% of the total FDI?\n', '', '', '$30', '$9', '$60', '$40', 'a', 'Level 2', 'PPL'),
(188, 'If in the previous question, the growth in the size of\nFDI for the next year with respect to the previous\nyear is 20%, then find the share of urban Maharashtra\nnext year if 12% of the total FDI going to Maha-\nrashtra went to urban areas (provided Maharashtra\nattracted only 10% of the total share for both years).\n', '', '', '$36', '$4.32', '$3', '$5', 'b', 'Level 2', 'PPL'),
(189, 'The cost of food accounted for 25% of the income\nof a particular family. If the income gets raised by\n20%, then what should be the percentage point de-\ncrease in the food expenditure as a percentage of the\ntotal income to keep the food expenditure unchanged\nbetween the two years?\n', '', '', '3.5', '8.33', '4.16', '5', 'c', 'Level 2', 'PPL'),
(190, 'If the length, breadth and height of a cube are de-\ncreased, decreased and increased by 5%, 5% and\n20%, respectively, then what will be the impact on\nthe surface area of the cube (in percentage terms)?\n', '', '', '7.25%', '5%', '8.33%', '6.08%', 'd', 'Level 2', 'PPL'),
(191, 'The price of raw materials has gone up by 15%,\nlabour cost has also increased from 25% of the cost\nof raw material to 30% of the cost of raw material.\nBy how much percentage should there be a reduction\nin the usage of raw materials so as to keep the cost\nsame?\n', '', '', '17%', '24%', '28%', '25%', 'a', 'Level 3', 'PPL'),
(192, 'Mr. A is a computer programmer. He is assigned\nthree jobs for which time allotted is in the ratio of\n5 : 4 : 2 (jobs are needed to be done individually).\nBut due to some technical snag, 10% of the time\nallotted for each job gets wasted. Thereafter, owing\nto the lack of interest, he invests only 40%, 30%\nand 20% of the hours of what was actually allotted\nto do the three jobs individually. Find how much\npercentage of the total time allotted is the time in-\nvested by A.\n', '', '', '38.33%', '39.45%', '32.72%', '36.66%', 'c', 'Level 3', 'PPL'),
(193, 'In the Mock CAT paper at Mindworkzz, questions\nwere asked in five sections. Out of the total students,\n5% candidates cleared the cut-off in all the sec-\ntions and 5% cleared none. Of the rest, 25% cleared\nonly one section and 20% cleared four sections. If\n24.5% of the entire candidates cleared two sections\nand 300 candidates cleared three sections, find out\nhow many candidates appeared at the Mock CAT at\nMindworkzz?\n', '', '', '1000', '1200', '1500', '2000', 'b', 'Level 3', 'PPL'),
(194, 'There are three galleries in a coal mine. On the first\nday, two galleries are operative and after some time,\nthe third gallery is made operative. With this, the\noutput of the mine became half as large again. What\nis the capacity of the second gallery as a percentage\nof the first, if it is given that a four-month output of\nthe first and the third galleries was the same as the\nannual output of the second gallery?\n', '', '', '70%', '64%', '60%', '65%', 'c', 'Level 3', 'PPL'),
(195, 'In an election of 3 candidates A, B and C, A gets\n50% more votes than B. A also beats C by 1,80,00\nvotes. If it is known that B gets 5 percentage point\nmore votes than C, find the number of voters on the\nvoting list (given 90% of the voters on the voting\nlist voted and no votes were illegal)\n', '', '', '72,000', '81,000', '90,000', ' 1,00,000', 'b', 'Level 3', 'PPL'),
(196, 'A clock is set right at 12 noon on Monday. It loses\n1/2% on the correct time in the first week but gains\n1/4% on the true time during the second week. The\ntime shown on Monday after two weeks will be\n', '', '', '12 : 25 : 12 ', '11 : 34 : 48', '12 : 50 : 24 ', ' 12 : 24 : 16', 'b', 'Level 3', 'PPL'),
(197, 'The petrol prices shot up by 7% as a result of the\nhike in the price of crudes. The price of petrol be-\nfore the hike was $28 per litre. Vawal travels 2400\nkilometres every month and his car gives a mileage\nof 18 kilometres to a litre. Find the increase in the\nexpenditure that Vawal has to incur due to the in-\ncrease in the price of petrol (to the nearest rupee)?\n\n', '', '', '$270', '$262', '$276', '$272', 'c', 'Level 3', 'PPL'),
(198, 'A shopkeeper announces a discount scheme as fol-\nlows: for every purchase of $3000 to $6000, the\ncustomer gets a 15% discount or a ticket that entitles\nhim to get a 7% discount on a further purchase of\ngoods costing more than $6000. The customer, how-\never, would have the option of reselling his right to\nthe shopkeeper at 4% of his initial purchase value\n(as per the right refers to the 7% discount ticket).\nIn an enthusiastic response to the scheme, 10 people\npurchase goods worth ` 4000 each. Find the maxi-\nmum. Possible revenue for the shopkeeper.\n', '', '', '$38,400', '$38,000', '$39,400', '$39,000', 'a', 'Level 3', 'PPL'),
(199, 'Abhimanyu Banerjee has 72% vision in his left eye\nand 68% vision in his right eye. On corrective ther-\napy, he starts wearing contact lenses, which augment\nhis vision by 15% in the left eye and 11% in the\nright eye. Find out the percentage of normal vision\nthat he possesses after corrective therapy. (Assume\nthat a persons eyesight is a multiplicative construct\nof the eyesights of his left and right eyes)\n', '', '', '52.50%', '62.50%', '72.50%', '68.60%', 'b', 'Level 3', 'PPL'),
(200, 'A shopkeeper gives 3 consecutive discounts of 10%,\n15% and 15% after which he sells his goods at a\npercentage profit of 30.05% on the C.P. Find the\nvalue of the percentage profit that the shopkeeper\nwould have earned if he had given discounts of 10%\nand 15% only.\n', '', '', '53%', '62.50%', '72.50%', '68.60%', 'a', 'Level 3', 'PPL'),
(201, 'Krishna Iyer, a motorist uses 24% of his fuel in cov-\nering the first 20% of his total journey (in city driving\nconditions). If he knows that he has to cover another\n25% of his total journey in city driving conditions,\nwhat should be the minimum percentage increase\nin the fuel efficiency for non-city driving over the\ncity driving fuel efficiency, so that he is just able to\ncover his entire journey without having to refuel?\n(Approximately)\n', '', '', '39.20%', '43.50%', '45.60%', '41.20%', 'b', 'Level 3', 'PPL'),
(202, 'By selling a watch for $560, a shopkeeper incurs\na loss of 20%. Find the cost price of the watch for\nthe shopkeeper.', '', '', '$600', '$700', '$610', '$640', 'b', 'Level 1', 'PPL'),
(203, 'By selling a cap for $29.75, a man gains 6.25%.\nWhat will be the CP of the cap?\n', '', '', '$26', '$27.50', '$28', '$27.80', 'c', 'Level 1', 'PPL'),
(204, 'A cellular phone when sold for $ 3808 fetches a profit\nof 12%. Find the cost price of the cellular phone.\n', '', '', '$3,190', '$3,400', '$3,260', '$3,560', 'b', 'Level 1', 'PPL'),
(205, 'A machine costs $ 1025. If it is sold at a loss of\n25%, what will be its cost price as a percentage of\nits selling price?\n', '', '', '125%', '116.67%', '120%', '133.33%', 'd', 'Level 1', 'PPL'),
(206, 'A shopkeeper sold goods for $1800 and made a profit\nof 20% in the process. Find his profit per cent if he\nhad sold his goods for $ 1687.5.\n', '', '', '11.50%', '10.50%', '12.50%', '6.25%', 'c', 'Level 1', 'PPL'),
(207, 'A tablet is sold for $6612.5 at a profit of 15%. What\nwould have been the actual profit or loss on it, if it\nhad been sold for $ 5380?\n', '', '', '$370', '$410', '$480', '$340', 'a', 'Level 1', 'PPL'),
(208, 'A marble table when sold for $ 6400 gives a loss of\n11.11% to the merchant who sells it. Calculate his\nloss or gain per cent, if he sells it for $ 7812.\n', '', '', 'Loss of 8.625%', 'Profit of 8.5%', 'loss of 8%', 'Profit of 7.5%', 'b', 'Level 1', 'PPL'),
(209, 'By selling bouquets for $ 69, a florist gains 15%. At\nwhat price should he sell the bouquets to gain 20%\non the cost price?\n', '', '', '$72', '$75', '$66', '$78', 'a', 'Level 1', 'PPL'),
(210, 'A shopkeeper bought 480 chocolates at $ 6 per doz-\nen. If he sold all of them at $0.75 each, what was\nhis profit per cent?', '', '', '50%', '33.33%', '75%', '20%', 'a', 'Level 1', 'PPL'),
(211, 'A feeding bottle is sold for $ 150. Sales tax accounts\nfor one-fifth of this and profit one-third of the re-\nmainder. Find the cost price of the feeding bottle.', '', '', '$72', '$80', '$90', '$76', 'b', 'Level 1', 'PPL'),
(212, 'An iron merchant makes a profit of 30% by selling\niron at $ 26 per quintal. If he sells the iron at $ 22.50\nper quintal, what is his profit per cent on the whole\ninvestment?\n', '', '', '12.50%', '6.66%', '7.50%', '8%', 'a', 'Level 1', 'PPL'),
(213, 'The cost price of a shirt and a pair of trousers is $\n473. If the shirt costs 15% more than the trousers,\nfind the cost price of the trouser.\n', '', '', '$243', '$253', '$210', '$220', 'd', 'Level 1', 'PPL'),
(214, 'A pet shop owner sells two puppies at the same price.\nOn one he makes a profit of 25% and on the other\nhe suffers a loss of 25%. Find his loss or gain per\ncent on the whole transaction.\n', '', '', 'Gain of 6.25%', 'No profit no loss', 'Loss of 12.5%', 'loss of 6.25%', 'd', 'Level 1', 'PPL'),
(215, 'The marked price of a table is $1200, which is 20%\nabove the cost price. It is sold at a discount of 10%\non the marked price. find the profit per cent.\n', '', '', '10%', '8%', '7.50%', '6%', 'b', 'Level 1', 'PPL'),
(216, '125 toffees cost $ 75. Find the cost of one million\ntoffees if there is a discount of 40% on the selling\nprice for this quantity.\n', '', '', '$300,000', '$320,000', '$360,000', '$400,000', 'c', 'Level 1', 'PPL'),
(217, 'A shopkeeper marks the price of an article at $ 250.\nFind the cost price if after allowing a discount of\n20% he still gains 25% on the cost price.', '', '', '210', '160', '200', '180', 'b', 'Level 1', 'PPL'),
(218, 'A dozen pairs of gloves quoted at $120 are available\nat a discount of 20%. Find how many pairs of gloves\ncan be bought for $ 16.\n', '', '', '2', '3', '4', '6', 'a', 'Level 1', 'PPL'),
(219, 'Find a single discount equivalent to the discount\nseries of 25%, 20%, 10%.\n', '', '', '66%', '46%', '54%', '34%', 'b', 'Level 1', 'PPL'),
(220, 'The printed price of a calculator is $ 225. A retailer\npays $ 148.5 for it by getting successive discounts\nof 20% and another rate which is illegible. What is\nthe second discount rate?\n', '', '', '17%', '18.50%', '16%', '17.50%', 'd', 'Level 1', 'PPL'),
(221, 'How much percent more than the cost price should\na shopkeeper mark his goods, so that after allowing\na discount of 6.25% he should have a gain of 25%\non his outlay?', '', '', '33.33%', '16.66%', '25%', '20%', 'a', 'Level 1', 'PPL'),
(222, 'Mithilesh makes 750 articles at a cost of 60 paise\nper article. He fixes the selling price such that if\nonly 600 articles are sold, he would have made a\nprofit of 40% on the outlay. However, 120 articles\ngot spoilt and he was able to sell 630 articles at this\nprice. Find his actual profit percent as the percentage\nof total outlay assuming that the unsold articles are\nuseless.\n', '', '', '42%', '53%', '47%', '46%', 'c', 'Level 2', 'PPL'),
(223, 'A manufacturer estimates that on inspection 12% of\nthe articles he produces will be rejected. He accepts\nan order to supply 22,000 articles at $ 7.50 each.\nHe estimates the profit on his outlay including the\nmanufacturing of rejected articles, to be 20%. Find\nthe cost of manufacturing each article.\n', '', '', '$6', '$5.50', '$5', '$4.50', 'b', 'Level 2', 'PPL'),
(224, 'The cost of setting up the type of a magazine is\n$1000. The cost of running the printing machine is\n$ 120 per 100 copies. The cost of paper, ink and so\non is 60 paise per copy. The magazines are sold at\n$ 2.75 each. 900 copies are printed, but only 784\ncopies are sold. What is the sum to be obtained from\nadvertisements to give a profit of 10% on the cost?\n', '', '', '$730', '$720', '$726', '$736', 'c', 'Level 2', 'PPL'),
(225, 'A tradesman fixed his selling price of goods at 30%\nabove the cost price. He sells half the stock at this\nprice, one-quarter of his stock at a discount of 15%\non the original selling price and rest at a discount\nof 30% on the original selling price. Find the gain\npercent altogether.', '', '', '14.88%', '15.38%', '15.58%', '16.38%', 'b', 'Level 2', 'PPL'),
(226, 'Dolly goes to a shop to purchase a doll priced at\n400. She is offered 4 discount options by the shop-\nkeeper. Which of these options should she opt for to\ngain maximum advantage of the discount offered?\n', '', '', 'Single discount of 30%', '2 successive discounts of 15% each', '2 successive discounts of 20% and 10%', '2 successive discounts of 20% and 12%', 'a', 'Level 2', 'PPL'),
(227, 'A dishonest dealer marks up the price of his goods\nby 20% and gives a discount of 10% to the cus-\ntomer. He also uses a 900 gram weight instead of a 1\nkilogram weight. Find his percentage profit due to\nthese maneuvers.\n', '', '', '8%', '12%', '20%', '16%', 'c', 'Level 2', 'PPL'),
(228, 'A dishonest dealer marks up the price of his goods\nby 20% and gives a discount of 10% to the cus-\ntomer. Besides, he also cheats both his supplier and\nhis buyer by 100 grams while buying or selling 1\nkilogram. Find the percentage profit earned by the\nshopkeeper.', '', '', '20%', '25%', '32%', '27.50%', 'c', 'Level 2', 'PPL'),
(229, 'Cheap and Best, a kirana shop bought some apples\nat 4 per rupee and an equal number at 5 per rupee.\nHe then sold the entire quantity at 9 for 2 rupees.\nWhat is his percentage profit or loss?\n', '', '', '1.23% loss', '6.66%', '8.89%', 'No profit no loss', 'a', 'Level 2', 'PPL'),
(230, 'A watch dealer sells watches at $ 600 per watch.\nHowever, he is forced to give two successive dis-\ncounts of 10% and 5% respectively. However, he\nrecovers the sales tax on the net sale price from the\ncustomer at 5% of the net price. What price does a\ncustomer have to pay him to buy the watch?\n', '', '', '$539.75', '$539.65', '$538.75', '$538.65', 'd', 'Level 2', 'PPL'),
(231, 'Deb bought 100 kg of rice for $ 1100 and sold it at\na loss of as much money as he received for 20 kg\nrice. At what price did he sell the rice?\n', '', '', '$9 per kg', '$9.1666 per kg', '$9.5 per kg', '$10.33 per kg', 'b', 'Level 2', 'PPL'),
(232, 'A carpenter wants to sell 40 chairs. If he sells them\nat $ 156 per chair, he would be able to sell all the\nchairs. But for every $ 6 increase in price, he will\nbe left with one additional unsold chair. At what sell-\ning price would he be able to maximise his profits\n(assuming unsold chairs remain with him)?\n', '', '', '198', '192', '204', '210', 'a', 'Level 2', 'PPL'),
(233, 'A shopkeeper makes a profit of Q% by selling an\nobject for $ 24. Had the cost price and selling price\nbeen interchanged, it would have led to a loss of\n62.5Q%. With the latter cost price, what should be\nthe new selling price to get a profit of Q%?\n', '', '', '$34.40', '$32.50', '$25.60', '$38.40', 'd', 'Level 2', 'PPL'),
(234, 'Find the change in the percentage profit for a fruit\nvendor who, after finding 20% of the fruits rotten,\nincreased his selling price by 10% over and above\n15% that he was already charging?\n', '', '', '-15', '11.5', '-13.8', '-11.5', 'c', 'Level 2', 'PPL'),
(235, 'Find the selling price of goods if two salesmen claim\nto make 25% profit each, one calculating it on cost\nprice while another on the selling price, the differ-\nence in the profits earned being $ 100 and selling\nprice being the same in both the cases.', '', '', '$2,000', '$1,600', '$2,400', '$2,500', 'a', 'Level 2', 'PPL'),
(236, 'A shopkeeper calculates percentage profit on the buy-\ning price and another on the selling price. What will\nbe their difference in profits if both claim a profit of\n20% on goods sold for $ 3000?\n', '', '', '$200', '$100', '$400', '$150', 'b', 'Level 2', 'PPL'),
(237, '$1200 is lent out at 5% per annum simple interest for 3 years. Find the amount after 3 years.', '', '', '$1,380', '$1,290', '$1,470', '$1,200', 'a', 'Level 1', 'SI'),
(238, 'Interest obtained on a sum of $ 5000 for 3 years is 1500. Find the rate percent.', '', '', '8%', '9%', '10%', '11%', 'c', 'Level 1', 'SI'),
(239, '$2100 is lent at compound interest of 5% per annum for 2 years. Find the amount after two years.', '', '', '$2,300', '$2,315.25', '$2,310', '$2,320', 'b', 'Level 1', 'SI'),
(240, '$1694 is repaid after two years at compound interest. Which of the following is the value of the principal and the rate? ', '', '', '$ 1200, 20%', '$1300, 15%', '$1400,10%', '$1500,12%', 'c', 'Level 1', 'SI'),
(241, 'Find the difference between the simple and the compound interest at 5% per annum for 2 years on a principal of $2000.', '', '', '5', '105', '4.5', '5.5', 'a', 'Level 1', 'SI'),
(242, 'Find the rate of interest if the amount after 2 years of simple interest on a capital of $1200 is $1440.', '', '', '8%', '9%', '10%', '11%', 'c', 'Level 1', 'SI'),
(243, 'After how many years will a sum of $12,500 become $17,500 at the rate of 10% per annum?', '', '', '2 years', '3 years', '4 years', '5 years', 'c', 'Level 1', 'SI'),
(244, 'What is the difference between the simple interest on a principal of $500 being calculated at 5% per annum for 3 years and 4% per annum for 4 years?', '', '', '5', '10', '20', '40', 'a', 'Level 1', 'SI'),
(245, 'What is the simple interest on a sum of $700 if the rate of interest for the first 3 years is 8% per annum and for the last 2 years is 7.5% per annum?', '', '', '269', '283', '273', '280', 'c', 'Level 1', 'SI'),
(246, 'What is the simple interest for 9 years on a sum of 800 if the rate of interest for the first 4 years is 8% per annum and for the last 4 years is 6% per\r\nannum?', '', '', '400', '392', '352', 'Cannot be determined', 'd', 'Level 1', 'SI'),
(247, 'What is the difference between compound interest and simple interest for the sum of $20,000 over a 2 year period if the compound interest is calculated at 20% and simple interest is calculated at 23%?', '', '', '400', '460', '440', '450', 'a', 'Level 1', 'SI'),
(248, 'Find the compound interest on $1000 at the rate of 20% per annum for 18 months when interest is compounded half-yearly.', '', '', '331', '1331', '320', '325', 'a', 'Level 1', 'SI'),
(249, 'Find the principal if the interest compounded at the rate of 10% per annum for two years is $420.', '', '', '$2,000', '$2,200', '$1,000', '$1,100', 'a', 'Level 1', 'SI'),
(250, 'Find the principal if compound interest is charged on the principal at the rate of  16(2/3) per annum for two years and the sum becomes $196.', '', '', '$140', '$154', '$150', '$144', 'd', 'Level 1', 'SI'),
(251, 'The SBI lent $1331 to the Tata group at a compound interest and got $1728 after three years. What is the rate of interest charged if the interest is compounded annually?', '', '', '11%', '9.09%', '12%', '8.33 %', 'b', 'Level 1', 'SI'),
(252, 'In what time will $3300 become $3399 at 6% per annum interest compounded half-yearly?', '', '', '6 months', '1 year', '1.5 years', '3 months', 'a', 'Level 1', 'SI'),
(253, 'Ranjan purchased a Maruti van for $1,96,000 and the rate of depreciation is 14(2/7) % per annum. Find the value of the van after two years.', '', '', '$140,000', '$144,000', '$150,000', '$1,60,000', 'b', 'Level 1', 'SI'),
(254, 'At what percentage per annum, will $10,000 amount to $17,280 in three years? (Compound Interest being\nreckoned)', '', '', '20%', '14%', '24%', '11%', 'a', 'Level 1', 'SI'),
(255, 'Vinay deposited $8000 in ICICI Bank, which pays him 12% interest per annum compounded quarterly. What is the amount that he receives after\n15 months?', '', '', '$9,274.20', '$9,228.80', '$9,314.30', '$9,338.80', 'a', 'Level 1', 'SI'),
(256, 'What is the rate of simple interest for the first 4 years if the sum of $360 becomes $540 in 9 years and the rate of interest for the last 5 years is 6%?', '', '', '4%', '5%', '3%', '6%', 'b', 'Level 1', 'SI'),
(257, 'A sum of money invested at simple interest triples\nitself in 8 years at simple interest. Find in how many\nyears will it become 8 times itself at the same rate?\n', '', '', '24 yrs', '28 yrs', '30 yrs', '21 yrs', 'b', 'Level 2', 'SI'),
(258, 'A sum of money invested at simple interest triples\nitself in 8 years. How many times will it become in\n20 years time?\n', '', '', '8 times', '7 times', '6 times', '9 times', 'c', 'Level 2', 'SI'),
(259, 'If $ 1100 is obtained after lending out $ x at 5%\nper annum for 2 years and $ 1800 is obtained after\nlending out $ y at 10% per annum for 2 years, find\nx + y.\n', '', '', '$2,500', '$3,000', '$2,000', '$2,200', 'a', 'Level 2', 'SI'),
(260, 'Find the amount which a sum of $ 9000 taken for\n12 years becomes at the end of 12 years.\n', 'A certain sum of money was lent under the following\r\nrepayment scheme based on Simple Interest:\r\n8% per annum for the initial 2 years\r\n9.5% per annum for the next 4 years\r\n11% per annum for the next 2 years\r\n12% per annum after the first 8 years', '', '20200', '19800', '20000', '20160', 'd', 'Level 2', 'SI'),
(261, 'If a person repaid $ 22,500 after 10 years of borrow-\ning a loan, at 10% per annum simple interest find\nout what amount did he take as a loan?\n', 'A certain sum of money was lent under the following\r\nrepayment scheme based on Simple Interest:\r\n8% per annum for the initial 2 years\r\n9.5% per annum for the next 4 years\r\n11% per annum for the next 2 years\r\n12% per annum after the first 8 years', '', '11225', '11250', '10000', '7500', 'b', 'Level 2', 'SI'),
(262, 'Mr. X, a very industrious person, wants to establish\nhis own unit. For this he needs an instant loan of\n$ 5,00,000 and, every five years he requires an ad-\nditional loan of $100,000. If he had to clear all his\noutstandings in 20 years, and he repays the principal\nof the first loan equally over the 20 years, find what\namount he would have to pay as interest on his initial\nborrowing if the rate of interest is 10% p.a. Simple\nInterest.\n', 'A certain sum of money was lent under the following\r\nrepayment scheme based on Simple Interest:\r\n8% per annum for the initial 2 years\r\n9.5% per annum for the next 4 years\r\n11% per annum for the next 2 years\r\n12% per annum after the first 8 years', '', '$560,000', '$540,000', '$525,000', '$500,000', 'c', 'Level 2', 'SI'),
(263, 'The population of a city is 200,000. If the annual\nbirth rate and the annual death rate are 6% and 3% respectively, then calculate the population of the city\nafter 2 years.\n', '', '', '212090', '206090', '212000', '212180', 'd', 'Level 2', 'SI'),
(264, 'A part of $ 38,800 is lent out at 6% per six months.\nThe rest of the amount is lent out at 5% per annum\nafter one year. The ratio of interest after 3 years\nfrom the time when first amount was lent out is\n5 : 4. Find the second part that was lent out at 5%.\n', '', '', '$26,600', '$28,800', '$27,500', '$28,000', 'b', 'Level 2', 'SI'),
(265, 'If the simple interest is 10.5% annual and compound\ninterest is 10% annual, find the difference between\nthe interests after 3 years on a sum of $ 1000.\n', '', '', '$15', '$12', '$16', '$11', 'c', 'Level 2', 'SI'),
(266, 'A sum of $ 1000 after 3 years at compound inter-\nest becomes a certain amount that is equal to the\namount that is the result of a 3 year depreciation\nfrom $ 1728. Find the difference between the rates\nof CI and depreciation. (Given CI is 10% p.a.). (Ap-\nproximately)\n\n', '', '', '3.33%', '0.66%', '3%', '2%', 'd', 'Level 2', 'SI'),
(267, 'The RBI lends a certain amount to the SBI on simple\ninterest for two years at 20%. The SBI gives this\nentire amount to Bharti Telecom on compound inter-\nest for two years at the same rate annually. Find the\npercentage earning of the SBI at the end of two years\non the entire amount.\n', '', '', '4%', '3(1/7)%', '3(2/7)%', '3(6/7)%', 'a', 'Level 2', 'SI'),
(268, 'Find the compound interest on $ 64,000 for 1 year\nat the rate of 10% per annum compounded quarterly\n(to the nearest integer).\n', '', '', '$8,215', '$8,205', '$8,185', 'None Of These', 'd', 'Level 2', 'SI'),
(269, 'If a principal P becomes Q in 2 years when inter-\nest R% is compounded half-yearly. And if the same\nprincipal P becomes Q in 2 years when interest S%\nis compound annually, then which of the following\nis true?\n', '', '', 'R>S', 'R=S', 'R<S', 'R<=S', 'c', 'Level 2', 'SI'),
(270, 'Find the compound interest at the rate of 10% for 3\nyears on that principal which in 3 years at the rate\nof 10% per annum gives $ 300 as simple interest. ', '', '', '$331', '$310', '$330', '$333', 'a', 'Level 2', 'SI'),
(271, 'The difference between CI and SI on a certain sum\nof money at 10% per annum for 3 years is $ 620.\nFind the principal if it is known that the interest is\ncompounded annually.\n', '', '', '200000', '20000', '10000', '100000', 'b', 'Level 2', 'SI'),
(272, 'The population of Mangalore was 1283575 on 1\nJanuary 2011 and the growth rate of population\nwas 10% in the last year and 5% in the years prior\nto it, the only exception being 2009 when because\nof a huge exodus there was a decline of 20% in\npopulation. What was the population on January 1,\n2005?\n', '', '', '1000000', '1200000', '1250000', '1500000', 'b', 'Level 2', 'SI'),
(273, 'According to the 2011 census, the population growth\nrate of Lucknow is going to be an increasing AP\nwith first years rate as 5% and common difference\nas 5%, but simultaneously the migration, rate is an\nincreasing GP with first term as 1% and common\nratio of 2. If the population on 31 December 2010\nis 1 million, then find in which year will Lucknow\nwitness its first fall in population?\n', '', '', '2015', '2016', '2017', '2018', 'b', 'Level 2', 'SI'),
(274, 'Mohit Anand borrows a certain sum of money from\nthe Mindworkzz Bank at 10% per annum at com-\npound interest. The entire debt is discharged in full\nby Mohit Anand on payment of two equal amounts\nof $ 1000 each, one at the end of the first year and\nthe other at the end of the second year. What is the\napproximate value of the amount borrowed by him?\n', '', '', '$1,852', '$1,736', '$1,694', '$1,792', 'b', 'Level 2', 'SI'),
(275, 'In order to buy a car, a man borrowed $ 180,000\non the condition that he had to pay 7.5% interest\nevery year. He also agreed to repay the principal\nin equal annual instalments over 21 years. After a\ncertain number of years, however, the rate of interest\nhas been reduced to 7%. It is also known that at the\nend of the agreed period, he will have paid in all\n$ 270,900 in interest. For how many years does he\npay at the reduced interest rate?\n', '', '', '7 yrs', '12 yrs', '14 yrs', '16 yrs', 'c', 'Level 2', 'SI'),
(276, 'A sum of $ 8000 is borrowed at 5% p.a. compound\ninterest and paid back in 3 equal annual instalments.\nWhat is the amount of each instalment?\n', '', '', '$2,937.67', '$3,000', '$2,037.67', '$2,739.76', 'a', 'Level 2', 'SI');
